import { Route, Routes } from "react-router-dom";
import {} from "rea" 
import Layout from "../../components/organisms/Layout/Layout";
import Home from "../";
import Step_1 from "../../Pages/Register/Step_1/Step_1";
import Step_2 from "../../Pages/Register/Step_2/Step_2";


const Log = () => {
    return (
        <>
            <Routes>
                <Route
                    exact
                    element={
                        <Layout />
                    }
                    children={
                        <>
                            <Route
                                exact
                                path="/"
                                element={
                                    <Suspense fallback={<div>...Skeleton</div>}>
                                        <Home></Home>
                                    </Suspense>
                                }
                            />
                            <Route
                                exact
                                path="/register"
                                element={
                                    <Suspense fallback={<div>...Skeleton</div>}>
                                        <Step_1 />
                                    </Suspense>
                                }
                            />
                            <Route
                                exact
                                path="/register/step_2"
                                element={
                                    <Suspense fallback={<div>...Skeleton</div>}>
                                        <Step_2 />
                                    </Suspense>
                                }
                            />
                        </>
                    }
                />

            </Routes>
        </>
    );
};
export default Log;
